import React from "react";
import "./Header.css";
import StarBorderIcon from "@mui/icons-material/StarBorder";
import AttachFileIcon from "@mui/icons-material/AttachFile";

function SideBar() {
  return (
    <div>
      <div className="mail_button">
        <button className="px-7">메일 쓰기</button>
        <button className="px-7 border-l-[0.5px] border-gray-500">
          내게 쓰기
        </button>
      </div>
      {/* mail filter Icons */}
      <div className="flex items-center p-3 pl-6">
        <div className="text-[16px]">9</div>

        <StarBorderIcon fontSize="small" />

        <AttachFileIcon fontSize="small" />

        <div className="text-[5px] font-semibold border-[1.5px] rounded-[30px] w-[25px] border-black ">
          To
        </div>
        <div className="text-[11px] text-gray-500 mt-[2px]">안읽음</div>
        <div className="text-[11px] text-gray-500 mt-[2px]">중요</div>
        <div className="text-[11px] text-gray-500  mt-[2px]">첨부</div>
        <div className="text-[11px] text-gray-500 mt-[4px]">TO</div>
      </div>
    </div>
  );
}

export default SideBar;
